import React from "react";
import Hero from "../components/Hero.js";
import Features from "../components/Features.js";
import Footer from "../components/Footer.js";

const LandingPage = () => {
  return (
    <div>
      <Hero />
      <Features />
      <Footer />
    </div>
  );
};

export default LandingPage;
